#include<iostream>
#include<string>
#include<algorithm>
#include<string.h>
#include<stdlib.h>
#include<vector>
using namespace std;

struct Node {
    int x;
    int y;
} ;
typedef struct Node Node;
void tranverse(int a, int b, int *tag, vector<vector<char> >& grid) { 
    int dx[4] = {-1, 0, 1, 0};
    int dy[4] = {0, 1, 0, -1};
    int row = grid.size();
    int col = grid[0].size();
    for(int i = 0; i < 4; i++) {
        int dir_x = a + dx[i];
        int dir_y = b + dy[i];
        if(dir_x >= 0 && dir_x <= row - 1 && dir_y >= 0 && dir_y <= col - 1) {
            if(grid[dir_x][dir_y] == 'O' && tag[dir_x * col + dir_y] == 0) {
                //cout<<"get"<<dir_x<<"\t"<<dir_y<<endl;
                tag[dir_x * col + dir_y] = 1;
                grid[dir_x][dir_y] = 'S';
                tranverse(dir_x, dir_y, tag, grid);
            }
        }  

    }   
}
void solve(vector<vector<char> >& board) {
    if(board.size() == 0)
        return;
    int row = board.size();
    int col = board[0].size();
    vector<Node> candidate;
    int should_change = 1;
    int *tag;
    tag = (int *)malloc(sizeof(int) * row * col);
    for(int i = 0; i< row; i++) 
        for(int j = 0; j< col ; j++)
            tag[i * col + j ] = 0;
    for(int i = 0; i < row; i++) {
        int j = 0;
        if(board[i][j] == 'O' && tag[i * col + j] == 0) {
            tag[i * col + j] = 1;
            board[i][j] = 'S';
            tranverse(i, j, tag, board);
        } 
        j = col - 1;
        if(board[i][j] == 'O' && tag[i * col + j] == 0) {
            tag[i * col + j] = 1;
            board[i][j] = 'S';
            tranverse(i, j, tag, board);
        }
    }
    for(int j = 0; j < col; j++) {
        int i = 0;
        if(board[i][j] == 'O' && tag[i * col + j] == 0) {
            tag[i * col + j] = 1;
            board[i][j] = 'S';
            tranverse(i, j, tag, board);
        } 
         i = row - 1;
        if(board[i][j] == 'O' && tag[i * col + j] == 0) {
            tag[i * col + j] = 1;
            board[i][j] = 'S';
            tranverse(i, j, tag, board);
        } 
    }
    for(int i = 0; i < row; i++) {
        for(int j = 0; j< col; j++) {
            if(board[i][j] == 'S') {
                board[i][j] = 'O';
            }
            else if(board[i][j] == 'O')
                board[i][j] = 'X';
        }
    }
}

